import React, { Component } from "react";

class Header extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-expand-md navbar-dark bg-dark sticky-top">
                    <h1 class="navbar-brand">itssamjo</h1>
                </nav>

                <h1>blogpage</h1>
            </div>
        );
    }
}

export default Header;
